    return (
        
  <div className="card">
    <div className="box">
      <div className="content">
        <h2>{name}</h2>
        <h3>{name}</h3><br/><br/>
        <h4>Click here to apply and we will contact you soon!</h4>
        <h5>sallary:{sallary}</h5>
        <a >Apply</a>
      </div>
    </div>
  </div>
  
    );
}

export default JobCard;
